@PCManticore With latest pylint 1.6.4, following still hits `invalid-sequence-index`:

```python
def my_list() -> Tuple[str, int]:
    return 'str', 1
```

Is that maybe another special case that needs special attention?

It will also break if you do this:
```python
def test():
    """"Test function."""
    data = []  # type List[int]
    for i in (1, 2, 2, 3, 5, 1, 2, 3):
        if i not in data:
            data.append(i)
````
using pylint pylint==1.6.5 and python 3.5.3
